import Block from './Block'

const BlockSet =() => {
    return(
        <div className="absolute top-[20%] w-[200%] h-[75%] bg-sharkGray">
            <Block top={"5%"} left={"5%"} text={"ㄱ"} z={"0"}/>
            <Block top={"17%"} left={"10%"} text={"ㄴ"} z={"0"}/>
            <Block top={"30%"} left={"15%"} text={"ㄷ"} z={"0"}/>
            <Block top={"17%"} left={"20%"} text={"ㄹ"} z={"10"}/>
            {/* <Block top={"30%"} left={"16%"} text={"ㅁ"}/> */}
            {/* <Block top={"30%"} left={"16%"} text={"ㅅ"}/> */}
            {/* <Block top={"30%"} left={"16%"} text={"ㅇ"}/> */}
            {/* <Block top={"30%"} left={"16%"} text={"ㅈ"}/> */}
            {/* <Block top={"30%"} left={"16%"} text={"ㅊ"}/> */}
            {/* <Block top={"30%"} left={"16%"} text={"ㅋ"}/> */}
        </div>
    )
}

export default BlockSet;
